import React from "react";
import { Card ,Button} from 'antd';

export const Counter = (props:propsType)=>{
    return(
        <Card title="step 1">
          <p></p>
          <p><Button>Run</Button></p>
        </Card>   
    )
}

interface propsType {
    step :number;
}
